import { useEffect, useState } from "react";

import MissionBody from "@components/Mission/MissionBody";
import MissionHead from "@components/Mission/MissionHead";

import AOS from "aos";

function Mission() {
  const [missionType, setMissionType] = useState("day");
  useEffect(() => {
    AOS.init();
  }, []);
  const handleMissionTypeClick = (type) => {
    setMissionType(type);
  };

  return (
    <>
      <MissionHead onMissionTypeClick={handleMissionTypeClick} />

      <MissionBody missionType={missionType} setMissionType={setMissionType} />
    </>
  );
}

export default Mission;
